import{_ as i,c as t,o as l,U as o,vQ as e,vR as n,vS as a,vT as r}from"./chunks/framework.lion5Oiu.js";const b=JSON.parse('{"title":"Set-up (I/O 1)","description":"","frontmatter":{"layout":"doc","outline":"deep"},"headers":[],"relativePath":"manual/setup/io_1.md","filePath":"manual/setup/io_1.md"}'),u={name:"manual/setup/io_1.md"},s=o('<h1 id="set-up-i-o-1" tabindex="-1">Set-up (I/O 1) <a class="header-anchor" href="#set-up-i-o-1" aria-label="Permalink to &quot;Set-up (I/O 1)&quot;">​</a></h1><p>Here is where you can configure the functions of the GPIO ports on the control box.</p><h3 id="_1-control-box-digital-input-function-definition" tabindex="-1">1. Control Box Digital Input Function Definition <a class="header-anchor" href="#_1-control-box-digital-input-function-definition" aria-label="Permalink to &quot;1. Control Box Digital Input Function Definition&quot;">​</a></h3><p><img src="'+e+'" alt="missing"></p><ol><li>Select the input port for which you want to change the function.</li><li><ul><li><strong>R</strong> : The function applied to the selected digital input port is activated when the digital input pulse is at the Rising Edge.<br></li><li><strong>H</strong> : The function applied to the selected digital input port is activated when the digital input pulse is at the High State.<br></li><li><strong>F</strong> : The function applied to the selected digital input port is activated when the digital input pulse is at the Falling Edge.<br></li><li><strong>L</strong> : The function applied to the selected digital input port is activated when the digital input pulse is at the Low State.</li></ul></li><li>The functions applied to the 16 digital input ports are displayed.</li></ol><h3 id="_2-control-box-digital-output-function-definition" tabindex="-1">2. Control Box Digital Output Function Definition <a class="header-anchor" href="#_2-control-box-digital-output-function-definition" aria-label="Permalink to &quot;2. Control Box Digital Output Function Definition&quot;">​</a></h3><p><img src="'+n+'" alt="missing"></p><ol start="4"><li>Select the output port for which you want to change the function.</li><li><ul><li><strong>R</strong> : The function applied to the selected digital output port is activated when the digital output pulse is at the Rising Edge.<br></li><li><strong>H</strong> : The function applied to the selected digital output port is activated when the digital output pulse is at the High State.<br></li><li><strong>F</strong> : The function applied to the selected digital output port is activated when the digital output pulse is at the Falling Edge.<br></li><li><strong>L</strong> : The function applied to the selected digital output port is activated when the digital output pulse is at the Low State.</li></ul></li><li>The functions applied to the 16 digital output ports are displayed.</li></ol><h3 id="_3-control-box-input-labels" tabindex="-1">3. Control Box Input Labels <a class="header-anchor" href="#_3-control-box-input-labels" aria-label="Permalink to &quot;3. Control Box Input Labels&quot;">​</a></h3><p><img src="'+a+'" alt="missing"></p><ol start="7"><li>Enter the desired name.</li><li>Select the input port for which you want to set the name.</li></ol><h3 id="_4-control-box-output-labels" tabindex="-1">4. Control Box Output Labels <a class="header-anchor" href="#_4-control-box-output-labels" aria-label="Permalink to &quot;4. Control Box Output Labels&quot;">​</a></h3><p><img src="'+r+'" alt="missing"></p><ol start="9"><li>Enter the desired name.</li><li>Select the output port for which you want to set the name.</li></ol><h3 id="_5-control-box-input-port-functionality" tabindex="-1">5. Control box input port functionality <a class="header-anchor" href="#_5-control-box-input-port-functionality" aria-label="Permalink to &quot;5. Control box input port functionality&quot;">​</a></h3><p>The functions of the input ports (Din 0 to Din 15) in the control box can be set to the following special functions (R = Rising Edge, F = Falling Edge, H = High State).</p><div class="warning custom-block"><p class="custom-block-title">Caution</p><ul><li> Before using Digital Input, be sure to fully understand the electrical characteristics of the digital input port provided by the manufacturer. </li></ul></div><ol start="0"><li>Basic Mode (GPIO)</li><li>Start Program Once Mode (Rising Edge)</li><li>Stop Program (Rising Edge)</li><li>Pause Program (Rising Edge)</li><li>R = Turn on Direct Teaching Mode / F = Turn off Direct Teaching Mode</li><li>R = Set Speed to 100% / F = Set Speed to 0%</li><li>R = Switch to Real Mode / F = Switch to Simulation Mode</li><li>R = Reset Robot</li><li>H = Disable Collision Function when in High State</li><li>H = Auto Initialization Key</li><li>R = Release Pause due to External Collision</li><li>R = Add Point Function to UI Program (Rising Edge)</li><li>R = Start Program in Repeat Mode (Rising Edge)</li><li>R = Move to Begin Position</li><li>R = Resume Program</li><li>H = Quick Freedrive Change</li><li>R = Pause Program / F = Resume Program</li><li>F = Pause Program / R = Resume Program</li><li>H = Speed Slider at 100% / L = Speed Slider at 0%</li><li>R = Load Default Program</li><li>F = Turn Off Robot Arm Power</li><li>R = Touch Sensing</li><li>F = Touch Sensing</li><li>H = No Arc</li><li>H = Program Start Block</li><li>R = Ext.Joint0 Plus / F = stop</li><li>R = Ext.Joint0 Minus / F = stop</li><li>R = Ext.Joint1 Plus / F = stop</li><li>R = Ext.Joint1 Minus / F = stop</li><li>R = Ext.Joint2 Plus / F = stop</li><li>R = Ext.Joint2 Minus / F = stop</li><li>H = Safety Speed</li><li>F = UserCoord0 ←TCP frame</li><li>F = UserCoord1 ←TCP frame</li><li>F = UserCoord2 ←TCP frame</li><li>F = Load &amp; Run Program Table</li><li>R = Start Prog.(Once) / F = Stop Prog.</li><li>R = Start Prog.(Repeat) / F = Stop Prog.</li><li>F = Change Global Pinpoint #’s Prog.</li><li>R = EXT. Joint 0 Slow Plus / F = Stop</li><li>R = EXT. Joint 0 Slow Minus / F = Stop</li><li>R = EXT. Joint 1 Slow Plus / F = Stop</li><li>R = EXT. Joint 1 Slow Minus / F = Stop</li><li>R = EXT. Joint 2 Slow Plus / F = Stop</li><li>R = EXT. Joint 2 Slow Minus / F = Stop</li><li>R = Reset SOS</li><li>F = Reset SOS</li><li>R = Delete Point</li><li>R = Add ARC-ON</li><li>R = Add ARC-Off</li><li>H = Speed 75% / L = 0%</li><li>H = Speed 50% / L = 0%</li><li>H = Speed 25% / L = 0%</li><li>H = Speed 10% / L = 0%</li><li>F = Pause Program</li><li>H = Block Freedrive Button</li><li>L = Block Freedrive Button</li><li>Duplex for Safety</li><li>F = Stop Program</li></ol><h3 id="_6-control-box-output-port-functionality" tabindex="-1">6. Control box output port functionality <a class="header-anchor" href="#_6-control-box-output-port-functionality" aria-label="Permalink to &quot;6. Control box output port functionality&quot;">​</a></h3><p>The functions of the output ports (Dout 0 to Dout 15) of the control box can be set to the following special functions (R = Rising Edge, F = Falling Edge, H = High State).<br> Output ports set to special features are not available for general use in teaching programs.</p><div class="warning custom-block"><p class="custom-block-title">Caution</p><ul><li> Before using the digital output, be sure to fully understand the electrical characteristics of the digital output port provided by the manufacturer. </li></ul></div><ol start="0"><li>Basic Mode (GPIO)</li><li>H = Program/Robot Running / L = Idle State</li><li>L = Program/Robot Running / H = Idle State</li><li>H = External Impact Detected</li><li>H = Direct Teaching Mode Active</li><li>Transmit the digital input signal with the same number as the selected port</li><li>Transmit Tool Flange Input Port 0 Signal</li><li>Transmit Tool Flange Input Port 1 Signal</li><li>H = Robot Active / L = Not Active</li><li>H = Real Mode / L = Simulation Mode</li><li>H = Robot in Operation / L = Idle</li><li>L = Robot in Operation / H = Idle</li><li>H = Robot Initialization (Activation) Failed</li><li>H = Power Supplied to Robot Arm / L = No Power to Arm</li><li>H = Collision Detection On / L = Collision Detection Off</li><li>H = Pause State</li><li>H = Trap Occurred in Inbox 0</li><li>H = Trap Occurred in Inbox 1</li><li>Used as PWM Module</li><li>H = Teaching Pendant Connected</li><li>H = Program Running in MAKE Screen</li><li>H = Program Running in PLAY Screen</li><li>H = Conveyor Mode Active</li><li>H = Control Box Boot Complete</li><li>H = Force Control Mode Active</li><li>PC Alive Pulse</li><li>H = Speed Slider at 100%</li><li>H = Last Program Load Successful</li><li>H = TCP is in InBox 0</li><li>H = TCP is in InBox 1</li><li>H = Is Alarm</li><li>H = Robot posture is Begin posture</li><li>H = Emergency Teaching Enable</li><li>H = Prog. Run in Sub.P area</li><li>H = Normal Program Run / L = Others</li><li>H = Normal Program Run / H = Others</li><li>H = Hand Controller F1 pressed</li><li>H = Hand Controller F2 pressed</li><li>H = Hand Controller F3 pressed</li><li>H = Hand Controller F4 pressed</li><li>L = TCP is in InBox 0</li><li>L = TCP is in InBox 1</li><li>Sync with Dout 0</li><li>Sync with Dout 1</li><li>Sync with Dout 2</li><li>Sync with Dout 3</li><li>Sync with Dout 4</li><li>Sync with Dout 5</li><li>Sync with Dout 6</li><li>Sync with Dout 7</li><li>Sync with Dout 8</li><li>Sync with Dout 9</li><li>Sync with Dout 10</li><li>Sync with Dout 11</li><li>Sync with Dout 12</li><li>Sync with Dout 13</li><li>Sync with Dout 14</li><li>Sync with Dout 15</li><li>H = Is SOS State</li><li>L = Is SOS State</li><li>H = EMG Button Released / L = Pressed</li><li>L = EMG Button Released / H = Pressed</li><li>L = Robot Speed under 250mm/s</li><li>H = Robot Speed under 250mm/s</li><li>H = Near Joint Limit</li><li>H = Robot Arm under Activating</li><li>H = Under Program Loading</li></ol>',22),p=[s];function c(d,h,g,S,m,f){return l(),t("div",null,p)}const P=i(u,[["render",c]]);export{b as __pageData,P as default};
